                      />
                    </div>
                    <div className="col-lg-6">
                      <input
                        type="text"
                        className="txtAdd"
                        onChange={(evt) => updateInputAdd(evt)}
                        placeholder="Blk/Floor/Unit"
                      />
                    </div>
                  </div>
                </div>
              </div>
            </div>

            {/* Stop off number 2 */}
            <div
              onClick={() => (click = 3)}
              style={{ display: "none" }}
              className="divStopoff1 divStopOff"
            >
